import React from 'react';
import Head from 'next/head'
import Header from './Header'

const Master_layout = ({children}) => {
    return ( 
        <>
                  <Head>
                      <title>Send Image </title>
                  </Head>
                     <Header/>
                  <div className="container">
                        {children}
                  </div>

        </>
     );
}
 
export default Master_layout;
